import React, { useContext } from 'react';
import { Link } from 'react-router-dom';
import { _Context } from '../../App';

const Form = () => {
  const { state: { country } } = useContext(_Context);
  return (
    <div>
      <Link to="/">Choose new country</Link>
      <h1>{country}</h1>
    </div>
  )
};

export default Form;
